REX dilecto & fideli ſuo Edmundo Comiti Cornub’, Salutem. Quia ſuper remediis contra pericula, quae toti Regno noſtro hiis diebus imminent, providendis, vobiſcum & cum caeteris Regni noſtri Proceribus habere volumus Colloquium & Tractatum: vobis mandamus, in fide & dilectione, quibus nobis tenemini, firmiter injungentes;


quòd Die Dominicâ proximâ poſt Feſtum Sancti Martini in hieme, proximè futura, apud Weſtm’
                      perſonaliter interſitis, ad tractandum, ordinandum, & faciendum nobiſcum, & cum Praelatis & caeteris Proceribus, & aliis Incolis Regni noſtri, qualiter ſit hujuſmodi periculis obviandis. T. R. apud Cantuariam, primo die Octobris, Anno Regni ſui xxiij.

REX venerabili in Chriſto Patri R. eâdem gratiâ Archiepiſcopo De Parliamento tenendo apud Weſtminaſterium.
Cantuarienſi, totius Angliae Primati, Salutem. Ad inſtantiam quorundam Praelatorum, Comitum & Baronum de Regno noſtro, nobiſcum in Parliamento noſtro London’ huc uſque 〈◊〉 ;
ac deſiderantium propter diutinam moram ſuam inibi factam ad partes proprias ſe transferre, & de ipſorum Conſilio & aſſenſu Parliamentum illud, uſque in diem Veneris proximum poſt Feſtum Omnium Sanctorum proximò futurum, apud Weſtm’ celebrandum, duximus continuandum; & quibuſdam de Praelatis, Comitibus, Baronibus praedictis licentiam conceſſimus ſe interim ad propria divertendos; ità videllcet, quòd ſint apud Weſtm’ ad dictum diem Veneris ad ultimum, nobiſcum ibidem ac etiam vobiſcum, ac cum caeteris Praelatis ac Comitibus, Baronibus & aliis fidelibus noſtris de Regno noſtro praedicto, qui nobiſcum intererunt tunc ibidem, ſuper diverſis & arduis negotiis, nos & ſtatum Regni noſtri tangentibus tractaturi: Et inſuper, ad hujuſmodi continuationem Parliamenti noſtri praedicti, apud Weſtm’, interim faciendam, venerabiles Patres W. Wigornenſem Epiſcopum, Cancellarium noſtrum, & J. Bathonenſem & Wellenenſem Epiſcopum, & dilectum & fidelem noſtrum Henricum de Percy; dilectúmque Clericum noſtrum Johannem de Sandale, Theſaurarium, Juſticiarios, & quoſdam alios fideles noſtros deputavimus loco noſtro. Et quia in Tractatum negotiorum praedictorum in Parliamento praedicto, veſtram praeſentiam perquàm neceſſariam reputamus: vobis mandamus, rogantes, quòd dicto die Veneris, ad ultimum, ſitis apud Weſtm’ in propriâ perſonâ veſtrâ, nobiſcum & cum caeteris Praelatis, Proceribus, & fidelibus ſupradictis, ſuper memoratis negotiis tractaturi, veſtrúmque Conſilium impenſuri; Et ut negotia praedicta feliciorem exitum ſortiantur, vobis ſimiliter mandamus, rogantes; quòd praemuniatis Decanos & Priores Eccleſiarum Cathedralium, ac etiam Capituli, necnon Abbates, Archidiaconos, ac totum Clerum veſtrae Dioceſ. totiúſque veſtrae Provinciae Cantuarienſis, quòd iidem Decani, Priores, Abbates & Archidiaconi, in propriis perſonis ſuis, dictaque Capitula & Cleros per Procuratores ſufficientes, plenam poteſtatem ab eiſdem Capitulo & Clero, hiis quae in Parliamento praedicto ordinari contigeret, conſentiendi habentes, eidem Parliamento in Octabis Sancti Martini proximò futuro, modis omnibus exhibeant ſe praeſentes. Teſte Rege apud London’ viij. die Octobris.

REX venerabili in Chriſto Patri J. eâdem gratiâ, Archiepiſcopo De Parliamento tenendo apud Weſtmonaſterium.
Cantuarienſi, totius Angliae Primati, Salutem. Cùm juxta formam treugarum inter nos & adverſarium noſtrum Franciae, apud Caleſiam initarum, concordatum fuiſſet; quòd nonnulli ſolemnes nuncij, durantibus dictis treugis, tam ex parte noſtrâ, quàm dicti Adverſarij noſtri ad Sedem Apoſtolicam, ad Tractandum ibidem de finali Pace inter nos & dictum Adverſarium noſtrum, mitterentur: Et nos ſuper hoc certos competentes Nuncios ad ſentiendum voluntatem Domini ſummi Pontificis, ſuper quibuſdam praeparatoriis, tam dictum tractatum Pacis, quàm miſſionem hujuſmodi majorum ſolemnium Nunciorum concernentibus; ac aliis de cauſis motivis, plurimum ad dictam Sedem, circiter Feſtum S. Andreae Apoſtoli proximò praeteritum, duxerimus tranſmittendos; tunc ſperantes certam reſponſionem ab ipſis Nunciis in ultimo Parliamento noſtro apud Weſtm’ tento veriſimiliter habuiſſe; de quibus quidem Nunciis ſeu eorum expeditione hactenus non recepimus quicquam certum; propter quod miſſionem majorum noſtrorum Nunciorum ſolemnium adhuc poſuimus in ſuſpenſo. Et quia (Deo dante) de dictis Nunciis & eorum expeditione, in proximo habere credimus certa nova; ſuper quibus; ac etiam ſuper eo, quod contra formam dictarum treugarum ex parte Adverſarij noſtri juratarum, quaedam notabiliter ponderanda, & in favorem noſtri noſtrorúmque fidelium & alligatorum adimplenda, per partis adverſae malitiam minimè ſunt impleta; necnon ſuper eo quod dictus noſter Adverſarius, contra bonam fidem, de ſperatâ Pace pro parte ſuâ promiſſa, maximam multitudinem hominum ad Arma, & aliorum, ac Navium & Galearum, potentiùs, quàm hactenus auditum fuerat, parat, ad dictum Regnum noſtrum Angliae hoſtiliter invadendum; ac nos & Dominium noſtrum pro viribus ſubvertendum, prout haec per manifeſta indicia ſatis liquent; expedit ut cum Praelatis, Proceribus, & Magnatibus ejuſdem Regni, abſque morae diſpendio ſalubre Conſilium habeamus;
per quod ex cauſis praedictis, & pro aliis terram & gentem Scotiae; necnon pro quibuſdam variis negotiis multùm arduis, tam nos, quàm ſtatum totius Regni noſtri praedicti ſpecialiter contingentibus, Parliamentum noſtrum apud Weſtm’ die Lunae proximò poſt diem Dominicam in medio Quadrageſimae, proximò futuro, tenere; vobiſcúmque & cum caeteris Praelatis, Magnatibus, & Proceribus praedictis Colloquium habere volumus & Tractatum; & ideo vobis in fide & dilectione, quibus nobis tenemini, firmiter injungendo mandamus, quatinus, ceſſante excuſatione quâcunque, dictis die & loco perſonaliter interſitis nobiſcum, ac cum dictis Praelatis, Magnatibus, & Proceribus dicti Regni, ſuper negotiis praedictis tractaturi veſtrúmque Conſilium impenſuri: Et hoc, ſicut nos & honorem noſtrum, ac communem utilitatem populi praedicti diligitis, nullatenus omittatis: Praemunientes Priorem & Capitulum Eccleſiae veſtrae Chriſti Cantuarienſis, ac Archidiaconos, totumque Clerum veſtrae Dioceſis; quod iidem Prior & Archidiaconi in propriis perſonis ſuis, ac dictum Capitulum per unum, idemque Clerus per duos Procuratores idoneos, plenam & ſufficientem poteſtatem ab ipſis Capitulo & Clero habentes, praedictis die & loco perſonaliter interſint, ad conſentiendum hiis, quae tunc ibidem de Communi Conſilio ipſius Regni noſtri, Divinâ favente clementiâ, contigerit ordinari. Teſte Rege apud Westm’ xiij. die Februarij.
